import{_ as e,c as l,o as i,a as t}from"./app.6426b36b.js";const u=JSON.parse('{"title":"http状态码","description":"","frontmatter":{"title":"http状态码","tags":["网络"],"excerpt":"HTTP的状态码","创建时间":"星期三, 七月 27日 2022, 8:58:57 晚上","修改时间":"星期四, 十一月 10日 2022, 1:41:33 下午"},"headers":[],"relativePath":"工作区/网络知识/常见的HTTP协议状态码.md"}'),a={name:"工作区/网络知识/常见的HTTP协议状态码.md"},c=t('<h1 id="http状态码" tabindex="-1">http状态码 <a class="header-anchor" href="#http状态码" aria-hidden="true">#</a></h1><ul><li>1xx 信息性状态码 websocket upgrade</li><li>2xx 成功状态码 <ul><li>200 服务器已成功处理了请求</li><li>204(没有响应体)</li><li>206(范围请求 暂停继续下载)</li></ul></li><li>3xx 重定向状态码 <ul><li>301(永久) ：请求的页面已永久跳转到新的url</li><li>302(临时) ：允许各种各样的重定向，一般情况下都会实现为到 <code>GET</code> 的重定向，但是不能确保 <code>POST</code> 会重定向为 <code>POST</code></li><li>303 只允许任意请求到 <code>GET</code> 的重定向</li><li>304 未修改：自从上次请求后，请求的网页未修改过</li><li>307：<code>307</code> 和 <code>302</code> 一样，除了不允许 <code>POST</code> 到 <code>GET</code> 的重定向</li></ul></li><li>4xx 客户端错误状态码 <ul><li>400 客户端参数错误</li><li>401 没有登录</li><li>403 登录了没权限 比如管理系统</li><li>404 页面不存在</li><li>405 禁用请求中指定的方法</li></ul></li><li>5xx 服务端错误状态码 <ul><li>500 服务器错误：服务器内部错误，无法完成请求</li><li>502 错误网关：服务器作为网关或代理出现错误</li><li>503 服务不可用：服务器目前无法使用</li><li>504 网关超时：网关或代理服务器，未及时获取请求</li></ul></li></ul><h1 id="" tabindex="-1"><a href="https://interview.html5.wiki/advance.html#_1-http%E5%89%8D%E7%94%9F%E4%BB%8A%E4%B8%96" target="_blank" rel="noreferrer">#</a> <a class="header-anchor" href="#" aria-hidden="true">#</a></h1>',3),o=[c];function d(r,_,n,s,h,p){return i(),l("div",null,o)}const x=e(a,[["render",d]]);export{u as __pageData,x as default};
